const initialState = {
    userDetail : {}
};
const Detail = (state = initialState, action) => {
    switch(action.type) {
        case "GET_DETAIL_SUCCESS":
          return {
            userDetail : action.userDetail
          };

        default:
          return state; 
      }
}

export default Detail;
